import {useEffect, useState} from "react";
import "../../../src/css/header.css"

export default function Order() {
    const [order, setOrders] = useState([]);

    const orders = () => {
        fetch("/order/get")
            .then(orders => orders.json())
            .then(orders => setOrders(orders))
    }

    useEffect(() => {
        orders()
    })

    return (
        <>
            <div className="order">
                {
                    order.map((order) => (
                        <table>
                            <th>Id</th>
                            <th>Name</th>
                            <th>Phone</th>
                        </table>
                    ))
                }

            </div>
        </>
    )
}
